import React from 'react'

function MyWork () {
    const textStyle = {
        textAlign: 'center'
    }
    return (
        <div>
            <h1 style={textStyle}>My Work</h1>
            <div class="work">
        
            </div>
        </div>
    ) 
}

export default MyWork
